import React from 'react'

const Menu = () => {
  return (
    <div className="about">
      <h2>About GeoCulture</h2>
      <p>Planning a trip and need to decide which museums to visit? GeoCulture is an app to help you map out your cultural excursions whereever you are in the world! Search our database of over 1,000 works of art and save them to your list of favorites as you plan your trip.</p>
    </div>
  );
};

export default Menu;
